  return (
    <div class="box" style={{ width: "50%", margin: "0 auto", marginTop: "50px",paddingBottom:"70px" }}>
        <div class="columns mt-5 is-centered">
      <div class="column">First column</div>
      <div class="column">Second column</div>
    </div>
    </div>
    
  );
}

